import React from "react";
import './style.css';
import { Link } from 'react-router-dom'
import axios from 'axios';
import { ListApps } from './list'

export function AppListPage(props) {
    const [apps, setApps] = React.useState([])

    function getApplications() {
        return axios.get('http://localhost:5001/api/applist')/*.then(data => {
           for (let i in data.data) {
            console.log(data.data[i].appType)
           }
        })*/
    }

    const clickHandler = () => {
        console.log(apps.discordId)
    }

    React.useEffect(() => {
        getApplications()
            .then(({ data }) => {
                setApps(data)
                apps.map(app => {
                    console.log(app.discordId)
                })
            }).catch(err => {
                console.log(err)
            })
    }, [])

    return (
        <body>
            <p onClick={clickHandler}>Test</p>
            <div>
                {apps.map(app => {
                    return (
                        <li key={app.applicationId}>
                            <span className="name">{app.user} </span>
                            <span className="type">{app.appType} </span>
                            <span className="date">{app.date}</span>
                        </li>
                    )
                })}
            </div>
        </body>
    )
}
